from __future__ import division


def unparse_color(r, g, b, a, type):
    if type == '#rgb':
        if r % 17 == 0 and g % 17 == 0 and b % 17 == 0:
            return f'#{r // 17:x}{g // 17:x}{b // 17:x}'
        else:
            return f'#{r:02x}{g:02x}{b:02x}'
    elif type == '#rgba':
        if r % 17 == 0 and g % 17 == 0 and b % 17 == 0 and a in [0.0, 1.0]:
            return f'#{r // 17:x}{g // 17:x}{b // 17:x}{int(a * 255) // 17:x}'
        else:
            return f'#{r:02x}{g:02x}{b:02x}{int(a * 255):02x}'
    elif type == '#rrggbb':
        return f'#{r:02x}{g:02x}{b:02x}'
    elif type == '#rrggbbaa':
        return f'#{r:02x}{g:02x}{b:02x}{int(a * 255):02x}'
    elif type == 'rgb':
        return f'rgb({r}, {g}, {b})'
    elif type == 'rgba':
        return f'rgba({r}, {g}, {b}, {a})'
    else:
        raise ValueError("Invalid type specified")

